import*as SCALE from"./scales";import{removeDuplicates}from"./tools";export function isValid(e){return!!new RegExp("^[x0-9]*$","i").test(e)}export function toNotes(e,t){let o,r,n=[];for(let l=0;l<e.length;l++)isNaN(e[l])?n.push("x"):(r=t[l],(o=parseInt(e[l])+SCALE.A.indexOf(r))>SCALE.A.length-1&&(o-=SCALE.A.length),n.push(SCALE.A[o]));return n}export function getIntegerNotation(e){let t=[];for(let r=0;r<e.length;r++){var o=[];if(e[r]&&"x"!==e[r].toLowerCase()){for(let t=0;t<e.length;t++){if(!e[t]||"x"===e[t].toLowerCase()){o.push("x");continue}let n=SCALE.getInterval(e[r],e[t]);o.push(n)}o.includes(0)&&t.push(o)}}return console.log(t),t}export function stripFormula(e){let t=e.slice(0);return t=t.filter(e=>!isNaN(e)),removeDuplicates(t.sort(function(e,t){return e-t}))}